import React, { Component } from 'react';
import"./appbar.css"

class AppBar extends Component {
    render() {
        return (
            <div className="app-bar" >
                <img width="200px" alt="logo" src="data:image/png;base64," />
            </div>
        );
    }
}

export default AppBar;
